import React from "react";
import Link from "next/link";
import NavStyles from "./styles/navStyles";

const Nav = () => {
  return (
    <NavStyles>
      <Link href="/">
        <a>Home</a>
      </Link>
      <Link href="/page2">
        <a>Songs</a>
      </Link>
      <Link href="/artists">
        <a>Artists</a>
      </Link>
      <Link href="/albums">
        <a>Albums</a>
      </Link>
      <Link href="/composers">
        <a>Composers</a>
      </Link>
    </NavStyles>
  );
};

export default Nav;
